void addHistogramBar(int place, int num)
{
    /*
    Place is 0-4
    0 <|  4-7
    1 |> 10-13
    2 || 16-19
    3 <  22-25
    4 >  28-31

    num is 1+ (17+ is drawn the same)
    num is adjusted to 0+
    */
    num = num - 1;
    if (num > 15)
    {
        num = 15;
        int i, j;
        for (i = (4 + (6 * place)); i < (8 + (6 * place)); i++)
        {
            for (j = 98; j < 100; j++)
            {
                Screen[i][j] = 1;
            }
        }
    }
    if (num < 0)
    {
        return;
    }
    //(4 + (6 * place)); i < (8 + (6 * place))
    int i, j;
    for (i = (4 + (6 * place)); i < (8 + (6 * place)); i++)
    {
        for (j = 5; j < (8 + (6 * num)); j++)
        {
            Screen[i][j] = 1;
        }
    }
}
