// translate into format render_image can understand
void translate_image(char toTranslate[32][128])
{
    // init loop values
    int i, j, k;
    int placement_index = 0;
    // iterating over the 4 segments of the column
    for (i = 0; i < 4; i++)
    {
        // control segments added
        int index_start, index_end;
        if (i == 0)
        {
            index_start = 0;
            index_end = 7;
        }
        else if (i == 1)
        {
            index_start = 8;
            index_end = 15;
        }
        else if (i == 2)
        {
            index_start = 16;
            index_end = 23;
        }
        else if (i == 3)
        {
            index_start = 24;
            index_end = 31;
        }

        // iterating over columns
        for (j = 0; j < 128; j++)
        {

            int n = 0;
            for (k = index_start; k < index_end; k++)
            {
                // clear bit if zero
                if (toTranslate[k][j] == (char)0)
                {
                    DrawingScreen[placement_index] &= ~((char)1 << n);
                }
                // set bit if 1
                if (toTranslate[k][j] == (char)1)
                {
                    DrawingScreen[placement_index] |= (char)1 << n;
                }
                n++;
            }

            placement_index++;
        }
    }
}

int getsw()
{
    int returnValue = PORTD;
    //               4321
    returnValue &= 0b111100000000;
    returnValue = returnValue >> 8;

    // returning status on SW1-SW4
    // return is 4321
    return returnValue;
}

int getbtns()
{
    int returnValue = PORTD;
    // btns          432
    returnValue &= 0b11100000;
    returnValue = returnValue >> 5;

    int btn1 = PORTF;
    // btn    1
    btn1 &= 0b10;
    btn1 = btn1 >> 1;

    // returning status on B1-B4
    // return is 4321
    returnValue = returnValue << 1;
    returnValue += btn1;
    return returnValue;
}

void ChangeScreen(enum ScreenType ChangeTo)
{
    if (ChangeTo == MainMenu)
    {
        clearScreen();
        CurrentScreen = MainMenu;
        addToScreen(MainScreen);
    }
    else if (ChangeTo == Bike)
    {
        clearScreen();
        CurrentScreen = Bike;
    }
    else if (ChangeTo == XYZ)
    {
        clearScreen();
        CurrentScreen = XYZ;
        addXYZ();
        addXYZPlace(0, x);
        addXYZPlace(1, y);
        addXYZPlace(2, z);
    }
    else if (ChangeTo == Histogram)
    {
        clearScreen();
        CurrentScreen = Histogram;
        addToScreen(HistogramScreen);
        addHistogramBar(0, 10);
        addHistogramBar(1, 0);
        addHistogramBar(2, 1);
        addHistogramBar(3, 16);
        addHistogramBar(4, 20);
    }
    else
    {
        ChangeScreen(MainMenu);
    }
}

void doScreenStuff()
{
    int btns = getbtns();
    int btn1 = btns & 0b0001;
    int btn2 = (btns & 0b0010) >> 1;
    int btn3 = (btns & 0b0100) >> 2;
    int btn4 = (btns & 0b1000) >> 3;

    if (CurrentScreen == MainMenu)
    {
        if (btn1 == 1)
        {
            ChangeScreen(Bike);
        }
        else if (btn2 == 1)
        {
            ChangeScreen(XYZ);
        }
        else if (btn3 == 1)
        {
            ChangeScreen(Histogram);
        }
        update_screen();
    }
    else if (CurrentScreen == Bike)
    {
        if (btn4 == 1)
        {
            if (ActiveLeftManualArrow == 1)
            {
                ActiveLeftManualArrow = 0;
                removeLeftManualArrow();
            }
            else
            {
                ActiveLeftManualArrow = 1;
                addLeftManualArrow();
            }
            update_screen();
        }
        if (btn3 == 1)
        {
            if (ActiveRightManualArrow == 1)
            {
                ActiveRightManualArrow = 0;
                removeRightManualArrow();
            }
            else
            {
                ActiveRightManualArrow = 1;
                addRightManualArrow();
            }
            update_screen();
        }
        if (btn2 == 1)
        {
            if (ActiveBrakeLight == 1)
            {
                ActiveBrakeLight = 0;
                removeBrakeLight();
            }
            else
            {
                ActiveBrakeLight = 1;
                addBrakeLight();
            }
            update_screen();
        }
        if (btn1 == 1)
        {
            ChangeScreen(MainMenu);
            update_screen();
        }
    }
    else if (CurrentScreen == XYZ)
    {
        xyz_data temporary;
        temporary = getACCL_XYZ_I2C();
        converter(temporary.x_data, 'x');
        converter(temporary.y_data, 'y');
        converter(temporary.z_data, 'z');

        if (btn1 == 1)
        {
            ChangeScreen(MainMenu);
            update_screen();
        }
        if (btn2 == 1)
        {
            ChangeScreen(XYZ);
            update_screen();
        }
    }
    else if (CurrentScreen == Histogram)
    {
        if (btn1 == 1)
        {
            ChangeScreen(MainMenu);
            update_screen();
        }
    }
    else
    {
        ChangeScreen(MainMenu);
        update_screen();
    }
}

